import { useState, useEffect } from 'react';

import Navbar from './Navbar';
import Todoview from './Todoview';
import Groupview from './Groupview';

import { useActiveClassroom } from '../../utils/providers/activeClassroom';

const Mainview = ({todoView}) => {
    const [ classes, setClasses ] = useState([]);
    const {activeClassroom}  = useActiveClassroom();

    return (
        <div className="full-container relative">
            <Navbar viewStatus={todoView}/>
            {todoView ? <Todoview /> : <Groupview />}
        </div>
    );
}

export default Mainview;
